import React from 'react';
import ReactDOM from 'react-dom/client';
import { BrowserRouter, Switch, Route, NavLink } from 'react-router-dom';
//-------------Componentes-------------//
import Comp1 from './Components/Componente1';
import Comp2 from './Components/Componente2';
import { Footer } from './Components/Footer';
import Wsp from './Components/WhatsappPNG';
import Copyri from './Components/Copyri'
//-------------StyleSheet-------------//
import "./style.css";
import "./wsp.css";
import "./Botons.css"

const NavBar = props =>(
  <>
    <header>
        <div className="company-logo" >
            
            LongDino
        </div>
        <nav className="navbar">
        <ul className="nav-items">
            <li className="nav-item">
                <a href="www.google.com" className="nav-link">
                    HOME
                </a>
            </li>
            <li className="nav-item">
                <a href="https://api.whatsapp.com/send?phone=+56936681029&text=Hola, Quisiera hacer unas consultas."  target="_blank" rel="noreferrer" className="nav-link">
                    <NavLink to="/Contact">CONTACT</NavLink>
                </a>
            </li>
        </ul>
        </nav>
        <div className="menu-toggle">
        <i className="bx bx-menu"></i>
        <i className="bx bx-x"></i>
        </div>
    </header>
    <div className="linetop"></div>
  </>
)

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <>
    <NavBar/>
    <Comp1/>
    <Comp2/>
    <Footer/>
    <Copyri/>
    <Wsp/>
  </>
);
